import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Button from 'react-bootstrap/Button';
import {
  Link
} from 'react-router-dom';

class JumboContact extends React.Component {
  render() {
    return (
      <Jumbotron fluid className="jumbo-padding">
        <div className="container-fluid">
    <div className="row">
      <div className="col-sm custom-jumbo">
        <h1>GET IN TOUCH</h1>
        <p>
        We are active across all social media hoping to build a wordwide StatHero community. Find us on socials or contact us using the information provided below.
        </p>

      </div>
        <div className="col-sm custom-about-jumbo">
        <img
            src={require("/Users/olliesaunderson/Documents/Year 3/Degree Project/prototypesite/src/Images/faqImages/JumboFAQImage.png")}
            alt="FAQ Feat Image"
            width="630px"
            height="500px"
          />
        </div>
    </div>
  </div>
      </Jumbotron>
    )
  }
}
export default JumboContact;
